(1497, '_transient_dash_88ae138922fe95674369b1cb3d215a2b', '<div class="rss-widget"><ul><li><a class=''rsswidget'' href=''https://wordpress.org/news/2017/01/wordpress-4-7-2-security-release/''>WordPress 4.7.2 Security Release</a> <span class="rss-date">January 26, 2017</span><div class="rssSummary">WordPress 4.7.2 is now available. This is a security release for all previous versions and we strongly encourage you to update your sites immediately. WordPress versions 4.7.1 and earlier are affected by three security issues: The user interface for assigning taxonomy terms in Press This is shown to users who do not have permissions to use it. [&hellip;]</div></li></ul></div><div class="rss-widget"><ul><li><a class=''rsswidget'' href=''https://wptavern.com/disqus-hits-sites-with-unwanted-advertising-plans-to-charge-large-publishers-a-monthly-fee-to-remove-ads''>WPTavern: Disqus Hits Sites with Unwanted Advertising, Plans to Charge Large Publishers a Monthly Fee to Remove Ads</a></li><li><a class=''rsswidget'' href=''https://wptavern.com/how-to-check-if-installed-plugins-are-no-longer-in-the-plugin-directory''>WPTavern: How to Check if Installed Plugins Are No Longer in the Plugin Directory</a></li><li><a class=''rsswidget'' href=''https://wptavern.com/wpweekly-episode-263-plugins-disappearing-wordcamp-miami-and-ostraining''>WPTavern: WPWeekly Episode 263 – Plugins Disappearing, WordCamp Miami, and OSTraining</a></li></ul></div><div class="rss-widget"><ul><li class="dashboard-news-plugin"><span>Popular Plugin:</span> Google Analytics Dashboard for WP&nbsp;<a href="plugin-install.php?tab=plugin-information&amp;plugin=google-analytics-dashboard-for-wp&amp;_wpnonce=0bf111acdb&amp;TB_iframe=true&amp;width=600&amp;height=800" class="thickbox open-plugin-details-modal" aria-label="Install Google Analytics Dashboard for WP">(Install)</a></li></ul></div>', 'no'),
