(2649, 1, '2017-01-15 02:12:37', '2017-01-15 02:12:37', '<h2>Headings</h2>\n<h1>Header one</h1>\n<h2>Header two</h2>\n<h3>Header three</h3>\n<h4>Header four</h4>\n<h5>Header five</h5>\n<h6>Header six</h6>\n<h2>Blockquotes</h2>\nSingle line blockquote:\n<blockquote>Stay hungry. Stay foolish.</blockquote>\nMulti line blockquote with a cite reference:\n<blockquote>People think focus means saying yes to the thing you''ve got to focus on. But that''s not what it means at all. It means saying no to the hundred other good ideas that there are. You have to pick carefully. I''m actually as proud of the things we haven''t done as the things I have done. Innovation is saying no to 1,000 things. </blockquote>\n<cite>Steve Jobs</cite> - Apple Worldwide Developers'' Conference, 1997\n<h2>Tables</h2>\n<table>\n<thead>\n<tr>\n<th>Employee</th>\n<th>Salary</th>\n<th></th>\n</tr>\n</thead>\n<tbody>\n<tr>\n<th><a href="http://example.org/">John Doe</a></th>\n<td>$1</td>\n<td>Because that''s all Steve Jobs needed for a salary.</td>\n</tr>\n<tr>\n<th><a href="http://example.org/">Jane Doe</a></th>\n<td>$100K</td>\n<td>For all the blogging she does.</td>\n</tr>\n<tr>\n<th><a href="http://example.org/">Fred Bloggs</a></th>\n<td>$100M</td>\n<td>Pictures are worth a thousand words, right? So Jane x 1,000.</td>\n</tr>\n<tr>\n<th><a href="http://example.org/">Jane Bloggs</a></th>\n<td>$100B</td>\n<td>With hair like that?! Enough said...</td>\n</tr>\n</tbody>\n</table>\n<h2>Definition Lists</h2>\n<dl><dt>Definition List Title</dt><dd>Definition list division.</dd><dt>Startup</dt><dd>A startup company or startup is a company or temporary organization designed to search for a repeatable and scalable business model.</dd><dt>#dowork</dt><dd>Coined by Rob Dyrdek and his personal body guard Christopher "Big Black" Boykins, "Do Work" works as a self motivator, to motivating your friends.</dd><dt>Do It Live</dt><dd>I''ll let Bill O''Reilly will <a title="We''ll Do It Live" href="https://www.youtube.com/watch?v=O_HyZ5aW76c">explain</a> this one.</dd></dl>\n<h2>Unordered Lists (Nested)</h2>\n<ul>\n	<li>List item one\n<ul>\n	<li>List item one\n<ul>\n	<li>List item one</li>\n	<li>List item two</li>\n	<li>List item three</li>\n	<li>List item four</li>\n</ul>\n</li>\n	<li>List item two</li>\n	<li>List item three</li>\n	<li>List item four</li>\n</ul>\n</li>\n	<li>List item two</li>\n	<li>List item three</li>\n	<li>List item four</li>\n</ul>\n<h2>Ordered List (Nested)</h2>\n<ol>\n	<li>List item one\n<ol>\n	<li>List item one\n<ol>\n	<li>List item one</li>\n	<li>List item two</li>\n	<li>List item three</li>\n	<li>List item four</li>\n</ol>\n</li>\n	<li>List item two</li>\n	<li>List item three</li>\n	<li>List item four</li>\n</ol>\n</li>\n	<li>List item two</li>\n	<li>List item three</li>\n	<li>List item four</li>\n</ol>\n<h2>HTML Tags</h2>\nThese supported tags come from the WordPress.com code <a title="Code" href="http://en.support.wordpress.com/code/">FAQ</a>.\n\n<strong>Address Tag</strong>\n\n<address>1 Infinite Loop\nCupertino, CA 95014\nUnited States</address><strong>Anchor Tag (aka. Link)</strong>\n\nThis is an example of a <a title="Apple" href="http://apple.com">link</a>.\n\n<strong>Abbreviation Tag</strong>\n\nThe abbreviation <abbr title="Seriously">srsly</abbr> stands for "seriously".\n\n<strong>Acronym Tag (<em>deprecated in HTML5</em>)</strong>\n\nThe acronym <acronym title="For The Win">ftw</acronym> stands for "for the win".\n\n<strong>Big Tag <strong>(<em>deprecated in HTML5</em>)</strong></strong>\n\nThese tests are a <big>big</big> deal, but this tag is no longer supported in HTML5.\n\n<strong>Cite Tag</strong>\n\n"Code is poetry." --<cite>Automattic</cite>\n\n<strong>Code Tag</strong>\n\nYou will learn later on in these tests that <code>word-wrap: break-word;</code> will be your best friend.\n\n<strong>Delete Tag</strong>\n\nThis tag will let you <del>strikeout text</del>, but this tag is no longer supported in HTML5 (use the <code>&lt;strike&gt;</code> instead).\n\n<strong>Emphasize Tag</strong>\n\nThe emphasize tag should <em>italicize</em> text.\n\n<strong>Insert Tag</strong>\n\nThis tag should denote <ins>inserted</ins> text.\n\n<strong>Keyboard Tag</strong>\n\nThis scarcely known tag emulates <kbd>keyboard text</kbd>, which is usually styled like the <code>&lt;code&gt;</code> tag.\n\n<strong>Preformatted Tag</strong>\n\nThis tag styles large blocks of code.\n<pre>.post-title {\n	margin: 0 0 5px;\n	font-weight: bold;\n	font-size: 38px;\n	line-height: 1.2;\n	and here''s a line of some really, really, really, really long text, just to see how the PRE tag handles it and to find out how it overflows;\n}</pre>\n<strong>Quote Tag</strong>\n\n<q>Developers, developers, developers...</q> --Steve Ballmer\n\n<strong>Strike Tag <strong>(<em>deprecated in HTML5</em>)</strong></strong>\n\nThis tag shows <span style="text-decoration:line-through;">strike-through text</span>\n\n<strong>Strong Tag</strong>\n\nThis tag shows <strong>bold<strong> text.</strong></strong>\n\n<strong>Subscript Tag</strong>\n\nGetting our science styling on with H<sub>2</sub>O, which should push the "2" down.\n\n<strong>Superscript Tag</strong>\n\nStill sticking with science and Isaac Newton''s E = MC<sup>2</sup>, which should lift the 2 up.\n\n<strong>Teletype Tag <strong>(<em>deprecated in HTML5</em>)</strong></strong>\n\nThis rarely used tag emulates <tt>teletype text</tt>, which is usually styled like the <code>&lt;code&gt;</code> tag.\n\n<strong>Variable Tag</strong>\n\nThis allows you to denote <var>variables</var>.', 'Markup: HTML Tags and Formatting', '', 'inherit', 'closed', 'closed', '', '1178-revision-v1', '', '', '2017-01-15 02:12:37', '2017-01-15 02:12:37', '', 1178, 'http://murren.ru/templates/WP//felix/felix-demo/?p=2649', 0, 'revision', '', 0),
(2650, 1, '2017-01-15 02:12:37', '2017-01-15 02:12:37', 'Welcome to image alignment! The best way to demonstrate the ebb and flow of the various image positioning options is to nestle them snuggly among an ocean of words. Grab a paddle and let''s get started.\n\nOn the topic of alignment, it should be noted that users can choose from the options of <em>None</em>, <em>Left</em>, <em>Right, </em>and <em>Center</em>. In addition, they also get the options of <em>Thumbnail</em>, <em>Medium</em>, <em>Large</em> &amp; <em>Fullsize</em>.\n<p style="text-align:center;"><img class="size-full wp-image-906 aligncenter" title="Image Alignment 580x300" alt="Image Alignment 580x300" src="http://wpthemetestdata.files.wordpress.com/2013/03/image-alignment-580x300.jpg" width="580" height="300" /></p>\nThe image above happens to be <em><strong>centered</strong></em>.\n\n<strong><img class="size-full wp-image-904 alignleft" title="Image Alignment 150x150" alt="Image Alignment 150x150" src="http://wpthemetestdata.files.wordpress.com/2013/03/image-alignment-150x150.jpg" width="150" height="150" /></strong>The rest of this paragraph is filler for the sake of seeing the text wrap around the 150x150 image, which is <em><strong>left aligned</strong></em>. <strong></strong>\n\nAs you can see the should be some space above, below, and to the right of the image. The text should not be creeping on the image. Creeping is just not right. Images need breathing room too. Let them speak like you words. Let them do their jobs without any hassle from the text. In about one more sentence here, we''ll see that the text moves from the right of the image down below the image in seamless transition. Again, letting the do it''s thang. Mission accomplished!\n\nAnd now for a <em><strong>massively large image</strong></em>. It also has <em><strong>no alignment</strong></em>.\n\n<img class="alignnone  wp-image-907" title="Image Alignment 1200x400" alt="Image Alignment 1200x400" src="http://wpthemetestdata.files.wordpress.com/2013/03/image-alignment-1200x4002.jpg" width="1200" height="400" />\n\nThe image above, though 1200px wide, should not overflow the content area. It should remain contained with no visible disruption to the flow of content.\n\n<img class="size-full wp-image-905 alignright" title="Image Alignment 300x200" alt="Image Alignment 300x200" src="http://wpthemetestdata.files.wordpress.com/2013/03/image-alignment-300x200.jpg" width="300" height="200" />\n\nAnd now we''re going to shift things to the <em><strong>right align</strong></em>. Again, there should be plenty of room above, below, and to the left of the image. Just look at him there... Hey guy! Way to rock that right side. I don''t care what the left aligned image says, you look great. Don''t let anyone else tell you differently.\n\nIn just a bit here, you should see the text start to wrap below the right aligned image and settle in nicely. There should still be plenty of room and everything should be sitting pretty. Yeah... Just like that. It never felt so good to be right.\n\nAnd just when you thought we were done, we''re going to do them all over again with captions!\n\n[caption id="attachment_906" align="aligncenter" width="580"]<img class="size-full wp-image-906  " title="Image Alignment 580x300" alt="Image Alignment 580x300" src="http://wpthemetestdata.files.wordpress.com/2013/03/image-alignment-580x300.jpg" width="580" height="300" /> Look at 580x300 getting some <a title="Image Settings" href="http://en.support.wordpress.com/images/image-settings/">caption</a> love.[/caption]\n\nThe image above happens to be <em><strong>centered</strong></em>. The caption also has a link in it, just to see if it does anything funky.\n\n[caption id="attachment_904" align="alignleft" width="150"]<img class="size-full wp-image-904  " title="Image Alignment 150x150" alt="Image Alignment 150x150" src="http://wpthemetestdata.files.wordpress.com/2013/03/image-alignment-150x150.jpg" width="150" height="150" /> Itty-bitty caption.[/caption]\n\n<strong></strong>The rest of this paragraph is filler for the sake of seeing the text wrap around the 150x150 image, which is <em><strong>left aligned</strong></em>. <strong></strong>\n\nAs you can see the should be some space above, below, and to the right of the image. The text should not be creeping on the image. Creeping is just not right. Images need breathing room too. Let them speak like you words. Let them do their jobs without any hassle from the text. In about one more sentence here, we''ll see that the text moves from the right of the image down below the image in seamless transition. Again, letting the do it''s thang. Mission accomplished!\n\nAnd now for a <em><strong>massively large image</strong></em>. It also has <em><strong>no alignment</strong></em>.\n\n[caption id="attachment_907" align="alignnone" width="1200"]<img class=" wp-image-907" title="Image Alignment 1200x400" alt="Image Alignment 1200x400" src="http://wpthemetestdata.files.wordpress.com/2013/03/image-alignment-1200x4002.jpg" width="1200" height="400" /> Massive image comment for your eyeballs.[/caption]\n\nThe image above, though 1200px wide, should not overflow the content area. It should remain contained with no visible disruption to the flow of content.\n\n[caption id="attachment_905" align="alignright" width="300"]<img class="size-full wp-image-905 " title="Image Alignment 300x200" alt="Image Alignment 300x200" src="http://wpthemetestdata.files.wordpress.com/2013/03/image-alignment-300x200.jpg" width="300" height="200" /> Feels good to be right all the time.[/caption]\n\nAnd now we''re going to shift things to the <em><strong>right align</strong></em>. Again, there should be plenty of room above, below, and to the left of the image. Just look at him there... Hey guy! Way to rock that right side. I don''t care what the left aligned image says, you look great. Don''t let anyone else tell you differently.\n\nIn just a bit here, you should see the text start to wrap below the right aligned image and settle in nicely. There should still be plenty of room and everything should be sitting pretty. Yeah... Just like that. It never felt so good to be right.\n\nAnd that''s a wrap, yo! You survived the tumultuous waters of alignment. Image alignment achievement unlocked!', 'Markup: Image Alignment', '', 'inherit', 'closed', 'closed', '', '1177-revision-v1', '', '', '2017-01-15 02:12:37', '2017-01-15 02:12:37', '', 1177, 'http://murren.ru/templates/WP//felix/felix-demo/?p=2650', 0, 'revision', '', 0),
(2651, 1, '2017-01-15 02:12:37', '2017-01-15 02:12:37', '<h3>Default</h3>\nThis is a paragraph. It should not have any alignment of any kind. It should just flow like you would normally expect. Nothing fancy. Just straight up text, free flowing, with love. Completely neutral and not picking a side or sitting on the fence. It just is. It just freaking is. It likes where it is. It does not feel compelled to pick a side. Leave him be. It will just be better that way. Trust me.\n<h3>Left Align</h3>\n<p style="text-align:left;">This is a paragraph. It is left aligned. Because of this, it is a bit more liberal in it''s views. It''s favorite color is green. Left align tends to be more eco-friendly, but it provides no concrete evidence that it really is. Even though it likes share the wealth evenly, it leaves the equal distribution up to justified alignment.</p>\n\n<h3>Center Align</h3>\n<p style="text-align:center;">This is a paragraph. It is center aligned. Center is, but nature, a fence sitter. A flip flopper. It has a difficult time making up its mind. It wants to pick a side. Really, it does. It has the best intentions, but it tends to complicate matters more than help. The best you can do is try to win it over and hope for the best. I hear center align does take bribes.</p>\n\n<h3>Right Align</h3>\n<p style="text-align:right;">This is a paragraph. It is right aligned. It is a bit more conservative in it''s views. It''s prefers to not be told what to do or how to do it. Right align totally owns a slew of guns and loves to head to the range for some practice. Which is cool and all. I mean, it''s a pretty good shot from at least four or five football fields away. Dead on. So boss.</p>\n\n<h3>Justify Align</h3>\n<p style="text-align:justify;">This is a paragraph. It is justify aligned. It gets really mad when people associate it with Justin Timberlake. Typically, justified is pretty straight laced. It likes everything to be in it''s place and not all cattywampus like the rest of the aligns. I am not saying that makes it better than the rest of the aligns, but it does tend to put off more of an elitist attitude.</p>', 'Markup: Text Alignment', '', 'inherit', 'closed', 'closed', '', '1176-revision-v1', '', '', '2017-01-15 02:12:37', '2017-01-15 02:12:37', '', 1176, 'http://murren.ru/templates/WP//felix/felix-demo/?p=2651', 0, 'revision', '', 0),
(2652, 1, '2017-01-15 02:12:37', '2017-01-15 02:12:37', 'Putting special characters in the title should have no adverse effect on the layout or functionality.\n\nSpecial characters in the post title have been known to cause issues with JavaScript when it is minified, especially in the admin when editing the post itself (ie. issues with metaboxes, media upload, etc.).\n<h2>Latin Character Tests</h2>\nThis is a test to see if the fonts used in this theme support basic Latin characters.\n<table>\n<tbody>\n<tr>\n<td>!</td>\n<td>"</td>\n<td>#</td>\n<td>$</td>\n<td>%</td>\n<td>&amp;</td>\n<td>''</td>\n<td>(</td>\n<td>)</td>\n<td>*</td>\n</tr>\n<tr>\n<td>+</td>\n<td>,</td>\n<td>-</td>\n<td>.</td>\n<td>/</td>\n<td>0</td>\n<td>1</td>\n<td>2</td>\n<td>3</td>\n<td>4</td>\n</tr>\n<tr>\n<td>5</td>\n<td>6</td>\n<td>7</td>\n<td>8</td>\n<td>9</td>\n<td>:</td>\n<td>;</td>\n<td>&gt;</td>\n<td>=</td>\n<td>&lt;</td>\n</tr>\n<tr>\n<td>?</td>\n<td>@</td>\n<td>A</td>\n<td>B</td>\n<td>C</td>\n<td>D</td>\n<td>E</td>\n<td>F</td>\n<td>G</td>\n<td>H</td>\n</tr>\n<tr>\n<td>I</td>\n<td>J</td>\n<td>K</td>\n<td>L</td>\n<td>M</td>\n<td>N</td>\n<td>O</td>\n<td>P</td>\n<td>Q</td>\n<td>R</td>\n</tr>\n<tr>\n<td>S</td>\n<td>T</td>\n<td>U</td>\n<td>V</td>\n<td>W</td>\n<td>X</td>\n<td>Y</td>\n<td>Z</td>\n<td>[</td>\n<td>\\</td>\n</tr>\n<tr>\n<td>]</td>\n<td>^</td>\n<td>_</td>\n<td>`</td>\n<td>a</td>\n<td>b</td>\n<td>c</td>\n<td>d</td>\n<td>e</td>\n<td>f</td>\n</tr>\n<tr>\n<td>g</td>\n<td>h</td>\n<td>i</td>\n<td>j</td>\n<td>k</td>\n<td>l</td>\n<td>m</td>\n<td>n</td>\n<td>o</td>\n<td>p</td>\n</tr>\n<tr>\n<td>q</td>\n<td>r</td>\n<td>s</td>\n<td>t</td>\n<td>u</td>\n<td>v</td>\n<td>w</td>\n<td>x</td>\n<td>y</td>\n<td>z</td>\n</tr>\n<tr>\n<td>{</td>\n<td>|</td>\n<td>}</td>\n<td>~</td>\n<td></td>\n<td></td>\n<td></td>\n<td></td>\n<td></td>\n<td></td>\n</tr>\n</tbody>\n</table>', 'Markup: Title With Special Characters', '', 'inherit', 'closed', 'closed', '', '1174-revision-v1', '', '', '2017-01-15 02:12:37', '2017-01-15 02:12:37', '', 1174, 'http://murren.ru/templates/WP//felix/felix-demo/?p=2652', 0, 'revision', '', 0),
(2653, 1, '2017-01-15 02:12:37', '2017-01-15 02:12:37', 'Verify that:\n<ul>\n	<li><span style="line-height:1.714285714;font-size:1rem;">The post title renders the word "with" in </span><em style="line-height:1.714285714;font-size:1rem;">italics</em><span style="line-height:1.714285714;font-size:1rem;"> and the word "markup" in </span><strong style="line-height:1.714285714;font-size:1rem;">bold</strong><span style="line-height:1.714285714;font-size:1rem;">.</span></li>\n	<li><span style="line-height:1.714285714;font-size:1rem;">The post title markup should be removed from the browser window / tab.</span></li>\n</ul>', 'Markup: Title With Markup', '', 'inherit', 'closed', 'closed', '', '1173-revision-v1', '', '', '2017-01-15 02:12:37', '2017-01-15 02:12:37', '', 1173, 'http://murren.ru/templates/WP//felix/felix-demo/?p=2653', 0, 'revision', '', 0),
(2654, 1, '2017-01-15 02:12:37', '2017-01-15 02:12:37', 'This post should display a <a title="Featured Images" href="http://en.support.wordpress.com/featured-images/#setting-a-featured-image" target="_blank">featured image</a>, if the theme <a title="Post Thumbnails" href="http://codex.wordpress.org/Post_Thumbnails" target="_blank">supports it</a>.\n\nNon-square images can provide some unique styling issues.\n\nThis post tests a vertical featured image.', 'Template: Featured Image (Vertical)', '', 'inherit', 'closed', 'closed', '', '1016-revision-v1', '', '', '2017-01-15 02:12:37', '2017-01-15 02:12:37', '', 1016, 'http://murren.ru/templates/WP//felix/felix-demo/?p=2654', 0, 'revision', '', 0),
(2655, 1, '2017-01-15 02:12:37', '2017-01-15 02:12:37', 'This post should display a <a title="Featured Images" href="http://en.support.wordpress.com/featured-images/#setting-a-featured-image" target="_blank">featured image</a>, if the theme <a title="Post Thumbnails" href="http://codex.wordpress.org/Post_Thumbnails" target="_blank">supports it</a>.\n\nNon-square images can provide some unique styling issues.\n\nThis post tests a horizontal featured image.', 'Template: Featured Image (Horizontal)', '', 'inherit', 'closed', 'closed', '', '1011-revision-v1', '', '', '2017-01-15 02:12:37', '2017-01-15 02:12:37', '', 1011, 'http://murren.ru/templates/WP//felix/felix-demo/?p=2655', 0, 'revision', '', 0),
(2656, 1, '2017-01-15 02:12:37', '2017-01-15 02:12:37', 'This content is before the <a title="The More Tag" href="http://en.support.wordpress.com/splitting-content/more-tag/" target="_blank">more tag</a>.\n\nRight after this sentence should be a "continue reading" button of some sort.\n\n<!--more-->\n\nAnd this content is after the more tag.', 'Template: More Tag', '', 'inherit', 'closed', 'closed', '', '996-revision-v1', '', '', '2017-01-15 02:12:37', '2017-01-15 02:12:37', '', 996, 'http://murren.ru/templates/WP//felix/felix-demo/?p=2656', 0, 'revision', '', 0),
(2657, 1, '2017-01-15 02:12:37', '2017-01-15 02:12:37', 'This is the post content. It should be displayed in place of the user-defined excerpt in single-page views.', 'Template: Excerpt (Defined)', 'This is a user-defined post excerpt. It should be displayed in place of the post content in archive-index pages.', 'inherit', 'closed', 'closed', '', '993-revision-v1', '', '', '2017-01-15 02:12:37', '2017-01-15 02:12:37', '', 993, 'http://murren.ru/templates/WP//felix/felix-demo/?p=2657', 0, 'revision', '', 0),
(2658, 1, '2017-01-15 02:12:37', '2017-01-15 02:12:37', 'This is the post content. It should be displayed in place of the auto-generated excerpt in single-page views. Archive-index pages should display an auto-generated excerpt of this content. Depending on Theme-defined filters, the length of the auto-generated excerpt will vary from Theme-to-Theme. The default length for auto-generated excerpts is 55 words, so to test the excerpt auto-generation, this post must have more than 55 words.\n\nBe sure to test the formatting of the auto-generated excerpt, to ensure that it doesn''t create any layout problems. Also, ensure that any filters applied to the excerpt, such as &lt;code&gt;excerpt_length&lt;/code&gt; and &lt;code&gt;excerpt_more&lt;/code&gt;, display properly.', 'Template: Excerpt (Generated)', '', 'inherit', 'closed', 'closed', '', '1446-revision-v1', '', '', '2017-01-15 02:12:37', '2017-01-15 02:12:37', '', 1446, 'http://murren.ru/templates/WP//felix/felix-demo/?p=2658', 0, 'revision', '', 0),
(2659, 1, '2017-01-15 02:12:37', '2017-01-15 02:12:37', 'Post Page 1\n\n<!--nextpage-->\n\nPost Page 2\n\n<!--nextpage-->\n\nPost Page 3', 'Template: Paginated', '', 'inherit', 'closed', 'closed', '', '1171-revision-v1', '', '', '2017-01-15 02:12:37', '2017-01-15 02:12:37', '', 1171, 'http://murren.ru/templates/WP//felix/felix-demo/?p=2659', 0, 'revision', '', 0),
(2660, 1, '2017-01-15 02:12:37', '2017-01-15 02:12:37', 'This is a sticky post.\n\nThere are a few things to verify:\n<ul>\n	<li>The sticky post should be distinctly recognizable in some way in comparison to normal posts. You can style the <code>.sticky</code> class if you are using the <a title="WordPress Codex post_class() Function" href="http://codex.wordpress.org/Function_Reference/post_class" target="_blank">post_class()</a> function to generate your post classes, which is a best practice.</li>\n	<li>They should show at the very top of the blog index page, even though they could be several posts back chronologically.</li>\n	<li>They should still show up again in their chronologically correct postion in time, but without the sticky indicator.</li>\n	<li>If you have a plugin or widget that lists popular posts or comments, make sure that this sticky post is not always at the top of those lists unless it really is popular.</li>\n</ul>', 'Template: Sticky', '', 'inherit', 'closed', 'closed', '', '1241-revision-v1', '', '', '2017-01-15 02:12:37', '2017-01-15 02:12:37', '', 1241, 'http://murren.ru/templates/WP//felix/felix-demo/?p=2660', 0, 'revision', '', 0),
(2661, 1, '2017-01-15 02:12:37', '2017-01-15 02:12:37', 'This content, comments, pingbacks, and trackbacks should not be visible until the password is entered.', 'Template: Password Protected (the password is "enter")', '', 'inherit', 'closed', 'closed', '', '1168-revision-v1', '', '', '2017-01-15 02:12:37', '2017-01-15 02:12:37', '', 1168, 'http://murren.ru/templates/WP//felix/felix-demo/?p=2661', 0, 'revision', '', 0),
(2662, 1, '2017-01-15 02:12:42', '2017-01-15 02:12:42', 'This post tests comments in the following ways.\n<ul>\n	<li>Threaded comments up to 10 levels deep</li>\n	<li>Paginated comments (set <em><strong>Settings &gt; Discussion &gt; Break comments into pages</strong></em> to <em><strong>5</strong></em> top level comments per page)</li>\n	<li>Comment markup / formatting</li>\n	<li>Comment images</li>\n	<li>Comment videos</li>\n	<li>Author comments</li>\n	<li>Gravatars and default fallbacks</li>\n</ul>', 'Template: Comments', '', 'inherit', 'closed', 'closed', '', '1148-revision-v1', '', '', '2017-01-15 02:12:42', '2017-01-15 02:12:42', '', 1148, 'http://murren.ru/templates/WP//felix/felix-demo/?p=2662', 0, 'revision', '', 0),
(2663, 1, '2017-01-15 02:12:42', '2017-01-15 02:12:42', 'This post has its comments, pingbacks, and trackbacks disabled.\n\nThere should be no comment reply form, but <em>should</em> display pingbacks and trackbacks.', 'Template: Comments Disabled', '', 'inherit', 'closed', 'closed', '', '1150-revision-v1', '', '', '2017-01-15 02:12:42', '2017-01-15 02:12:42', '', 1150, 'http://murren.ru/templates/WP//felix/felix-demo/?p=2663', 0, 'revision', '', 0),
(2664, 1, '2017-01-15 02:12:42', '2017-01-15 02:12:42', 'This post has many pingpacks and trackbacks.\n\nThere are a few ways to list them.\n<ol>\n	<li>Above the comments</li>\n	<li>Below the comments</li>\n	<li>Included within the normal flow of comments</li>\n</ol>', 'Template: Pingbacks And Trackbacks', '', 'inherit', 'closed', 'closed', '', '1149-revision-v1', '', '', '2017-01-15 02:12:42', '2017-01-15 02:12:42', '', 1149, 'http://murren.ru/templates/WP//felix/felix-demo/?p=2664', 0, 'revision', '', 0),
