(559, 1, '2010-05-09 07:51:54', '2010-05-09 14:51:54', '“I never tried to prove nothing, just wanted to give a good show. My life has always been my music, it''s always come first, but the music ain''t worth nothing if you can''t lay it on the public. The main thing is to live for that audience, ''cause what you''re there for is to please the people.”', 'Post Format: Aside', '', 'trash', 'closed', 'closed', '', 'post-format-aside__trashed', '', '', '2017-02-20 19:45:57', '2017-02-20 19:45:57', '', 0, 'http://wpthemetestdata.wordpress.com/?p=559', 0, 'post', '', 0);
