(1005, 1, '2010-06-02 03:00:34', '2010-06-02 10:00:34', '[wpvideo tFnqC9XQ w=680]\n\n<a title="VideoPress Plugin for WordPress" href="http://videopress.com/" target="_blank">VideoPress</a>, especially as a video post format, usually provides some unique styling issues.\n\nYou will need to install <a title="Jetpack for WordPress" href="http://jetpack.me/" target="_blank">Jetpack</a> or <a title="Slim Jetpack" href="http://wordpress.org/extend/plugins/slimjetpack/" target="_blank">Slim Jetpack</a> plugin to turn the shortcode into a viewable video.', 'Post Format: Video (VideoPress)', '', 'trash', 'closed', 'closed', '', 'post-format-video-videopress__trashed', '', '', '2017-02-20 19:45:54', '2017-02-20 19:45:54', '', 0, 'http://wptest.io/demo/?p=1005', 0, 'post', '', 0),
