(1175, 1, '2009-10-05 12:00:59', '2009-10-05 19:00:59', '<h2>Title should not overflow the content area</h2>\n\nA few things to check for:\n<ul>\n	<li>Non-breaking text in the title, content, and comments should have no adverse effects on layout or functionality.</li>\n	<li>Check the browser window / tab title.</li>\n	<li>If you are a plugin or widget developer, check that this text does not break anything.</li>\n</ul>\n\nThe following CSS properties will help you support non-breaking text.\n\n<pre>-ms-word-wrap: break-word;\nword-wrap: break-word;</pre>\n&nbsp;', 'Antidisestablishmentarianism', '', 'trash', 'closed', 'closed', '', 'title-should-not-overflow-the-content-area__trashed', '', '', '2017-02-20 19:46:09', '2017-02-20 19:46:09', '', 0, 'http://wptest.io/demo/?p=877', 0, 'post', '', 0),
